"use strict";(self.webpackChunknah_blog=self.webpackChunknah_blog||[]).push([[797],{9967:t=>{t.exports=JSON.parse('{"blogPosts":[{"id":"/2023/05/23/firststart","metadata":{"permalink":"/Nah-blog/izuna/2023/05/23/firststart","source":"@site/izuna/2023-05-23-firststart.md","title":"\uccab \uc2dc\uc791","description":"\uc2dc\uc791\ud55c \uacc4\uae30","date":"2023-05-23T00:00:00.000Z","formattedDate":"2023\ub144 5\uc6d4 23\uc77c","tags":[],"readingTime":2.245,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"nextItem":{"title":"Docusarus \uc0ac\uc6a9 \uc2dc\uc791","permalink":"/Nah-blog/izuna/2023/05/23/startdocusaurus"}},"content":"## \uc2dc\uc791\ud55c \uacc4\uae30\\n\\n### 1. \uc544\ub294\uc0ac\ub78c\uc758 \ube14\ub85c\uadf8 \uc81c\uc791\\n\uc6d0\ub798\ub294 \ube14\ub85c\uadf8 \uc81c\uc791\uc5d0 \ud070 \uad00\uc2ec\uc774 \uc5c6\uc5c8\ub2e4.\\n\uadf8\ub7ec\ub2e4\uac00 \uc544\ub294 \uc0ac\ub78c(\ubc31\uc5d4\ub4dc \uac1c\ubc1c\uc790,`I` \ub85c \uc11c\uc220)\uc774 \uc790\uc2e0\uc758 \ub3d9\ub8cc(\uce5c\uad6c, \ud504\ub860\ud2b8 \uac1c\ubc1c\uc790, `H` \ub85c \uc11c\uc220)\uc640 \ud568\uaed8 \ubc25\uc744 \uba39\uc790\ub294 \uc81c\uc548\uc744 \ud588\ub2e4.\\n\\nI\uacfc\ub294 \uc624\ub79c\uc2dc\uac04\ub3d9\uc548 \ub9cc\ub0ac\uc5c8\uace0, \ub098\uc5d0\uac8c \uc790\ubc14\ub97c \uac00\ub974\uccd0\uc8fc\uace0 \uc788\ub294 \uc0ac\ub78c\uc774\uae30\ub3c4 \ud558\ub2e4.\\n\\n`H`\ub294 `I`\uc758 \ub3d9\ub8cc\uc774\uae30\ub3c4 \ud558\uace0, \ub098\uc640\ub294 \ucc98\uc74c \ub9cc\ub098\ub294 \uc0ac\ub78c\uc774\uc5c8\uc9c0\ub9cc `I`\uac00 \ud504\ub860\ud2b8 \uac1c\ubc1c\uc790\ub97c \ub9cc\ub098\ubcf4\ub294\uac83\uc774 \uc5b4\ub5a0\ub0d0 \ud574\uc11c \ub9cc\ub098\uac8c \ub418\uc5c8\ub2e4.\\n\\n\ub9c9\uc0c1 \ub9cc\ub098\uace0\ubcf4\ub2c8 \ud504\ub860\ud2b8 \uac1c\ubc1c \uc791\uc5c5\uc5d0 \ub300\ud55c \uc7a5\uc810\uacfc \ub2e8\uc810\uc744 \ub9ce\uc774 \ub4e3\uac8c\ub418\uc5c8\uace0, \ud504\ub860\ud2b8 \uac1c\ubc1c\uc790\ub294 \uc0c1\uc0ac\uc640 \uc790\uc2e0\uc758 \ub3d9\ub8cc\ub4e4 \uc0ac\uc774\uc5d0\uc11c \ud070 \uace0\ub09c\uc744 \uacaa\ub294 \uc0ac\ub78c\uc774\ub77c\ub294\uac83\uc744 \ud655\uc2e4\ud558\uac8c \uae68\ub2eb\uac8c \ub418\uc5c8\ub2e4.\\n\\n\uadf8\ub798\uc11c \ub450\uba85\uacfc \ud568\uaed8 \ub9ce\uc740 \uc774\uc57c\uae30\ub97c \ub098\ub204\uc5c8\uace0, \ub354 \uc598\uae30\ub97c \ud558\uace0\uc2f6\uc5c8\uc9c0\ub9cc \ubc25\ub9cc \uba39\uace0 \ud5e4\uc5b4\uc84c\ub2e4.\\n\\n\uc5b4\ub290\ub0a0 `I`\uac00 \ub514\uc2a4\ucf54\ub4dc \ud654\uba74\uacf5\uc720\ub85c `I`\uc640 `H`\uac00 \ud568\uaed8 \ube14\ub85c\uadf8 \uc81c\uc791\ud558\ub294\uac83\uc911 \ud558\ub098\uc778 \ubc31\uc5d4\ub4dc \uac1c\ubc1c\ud558\ub294\uac83\uc744 \ubcf4\uc5ec\uc92c\ub2e4.\\n\\n\uadf8\ub798\uc11c \uacc4\uc18d \ubcf4\ub2e4\uac00 \ubcf4\uba74 \ubcfc\uc218\ub85d `\ub098\ub3c4 \ube14\ub85c\uadf8 \uc81c\uc791 \ud55c\ubc88 \ud574\ubcfc\uae4c?`\ub77c\ub294 \uc0dd\uac01\uc774 \uac11\uc790\uae30 \ub4e4\uc5b4\uc11c \uadf8 \ube14\ub85c\uadf8\uc758 \ud15c\ud50c\ub9bf\uc774 \ubb34\uc5c7\uc778\uc9c0 \ubb3c\uc5b4\ubcf4\uc558\ub2e4.\\n\\n[**`Facebook`**](https://github.com/facebook)\uc5d0\uc11c \uc81c\uc791\ud55c \uc624\ud508 \uc18c\uc2a4 \ud504\ub85c\uc81d\ud2b8 **`Docusaurus`**\ub77c\ub294 \ud504\ub85c\uc81d\ud2b8\ub97c \uc0ac\uc6a9\ud55c \uac04\ud3b8 \ube14\ub85c\uadf8 \uc81c\uc791 \ud15c\ud50c\ub9bf\uc774\uc5c8\ub2e4.\\n\\n\ub098\ub294 \uace7\uc7a5 [Docusaurus](https://docusaurus.io)\ub97c \uac80\uc0c9\ud574\uc11c \uacf5\uc2dd \ud648\ud398\uc774\uc9c0\uc5d0 \ub4e4\uc5b4\uac00\uc11c \ud15c\ud50c\ub9bf\uc744 \ub2e4\uc6b4\ubc1b\uc544\uc11c \uc81c\uc791\uc744 \uc2dc\uc791\ud588\ub2e4."},{"id":"/2023/05/23/startdocusaurus","metadata":{"permalink":"/Nah-blog/izuna/2023/05/23/startdocusaurus","source":"@site/izuna/2023-05-23-startdocusaurus.md","title":"Docusarus \uc0ac\uc6a9 \uc2dc\uc791","description":"\uc2dc\uc791 \uc804","date":"2023-05-23T00:00:00.000Z","formattedDate":"2023\ub144 5\uc6d4 23\uc77c","tags":[],"readingTime":0.715,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"\uccab \uc2dc\uc791","permalink":"/Nah-blog/izuna/2023/05/23/firststart"},"nextItem":{"title":"hello","permalink":"/Nah-blog/izuna/2023/05/22/hello"}},"content":"## \uc2dc\uc791 \uc804\\n\ub0b4\uac00 \uc0ac\uc6a9\ud558\ub294 \ub300\ubd80\ubd84\uc758 \ucf54\ub4dc\ub294 [\uc5ec\uae30](https://github.com/rainbow-flavor/roxy-blog) \uc5d0\uc11c \ucc38\uace0\ud558\uace0 \uc788\ub2e4.\\n- **Thanks for [Irostub](https://github.com/irostub), [Hank](https://github.com/hankbae93)**\\n\\n\ucc38\uace0 \uc790\ub8cc : [Docusaurus](https://docusaurus.io/ko/docs#fast-track)\\n\\n## 1. Node.js \uc124\uce58 \ubc0f \uc0ac\uc774\ud2b8 \uc81c\uc791\\n\uba3c\uc800 [Node.js](https://nodejs.org/ko/download) \ub97c \uc124\uce58\ud558\uace0 `Docusaurus`\uc0ac\uc774\ud2b8\ub97c \ub9cc\ub4e0\ub2e4.\\n\\n```bash\\nnpx create-docusarus@latest my-website classic\\n```\\n- `my-website`\ub294 \ud3f4\ub354\ub97c \ub9d0\ud558\ub294\uac83\uc774\ub2c8 \uc774\ub984\uc744 \uc6d0\ud558\ub294\ub300\ub85c \ubc14\uafb8\uba74\ub41c\ub2e4.\\n- `classic`\uc740 \ud15c\ud50c\ub9bf\uc744 \ub9d0\ud558\ub294\uac83\uc774\uba70 \ub530\ub85c \ud15c\ud50c\ub9bf\uc744 \uc124\uc815\ud560\uc218 \uc788\ub2e4.\\n\\n```bash\\ncd my-website\\nnpx docusaurus start\\n```\\nhttp://localhost:3000 \uc5d0\uc11c \uc790\uc2e0\uc758 \ud648\ud398\uc774\uc9c0\ub97c \ud655\uc778\ud560 \uc218 \uc788\ub2e4!"},{"id":"/2023/05/22/hello","metadata":{"permalink":"/Nah-blog/izuna/2023/05/22/hello","source":"@site/izuna/2023-05-22-hello.md","title":"hello","description":"Hello Blog!","date":"2023-05-22T00:00:00.000Z","formattedDate":"2023\ub144 5\uc6d4 22\uc77c","tags":[],"readingTime":0.035,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"Docusarus \uc0ac\uc6a9 \uc2dc\uc791","permalink":"/Nah-blog/izuna/2023/05/23/startdocusaurus"}},"content":"## Hello Blog!\\n\\n```javascript\\nconsole.log(\'Hello Blog!\');\\n```"}]}')}}]);